import "./about.scss"

export default function About() {
  return (
    <div className="about">
        <div className="mid">
            <img src="Images/mid.jpeg" alt="" />
        </div>
        <div className="projects"></div>
        <div className="mobileapp"></div>
        <div className="knowhow"></div>
    </div>
  )
}
